import { Component } from "react";

class portfolios extends React.Component {
    
    render(){
        return(
            <div>
                <h1>I am Portfolios page</h1>
                <a href="/">Home</a>
                <a href="/about">About</a>
                <a href="/portfolios">Portfolio</a>
                <a href="/blogs">Blog</a>
                <a href="/cv">CV</a>
            </div>
        )
    }
}

export default portfolios;
